import "./index.css";

function Item(props) {
  return (
    <div style={{ display: "flex", borderBottom: "1px solid black", padding:"15px" }}>
      <p>
        {props.num.id}. {props.num.task}
      </p>
    </div>
  );
}

export default Item;
